import React from "react";
// import Nav from  'react-bootstrap';
import { Nav } from 'react-bootstrap';

function UserNavigationSection() {
    return (
    
    <>
        <Nav fill variant="tabs">
        <Nav.Item>
            <Nav.Link href="/my-profile">Posts</Nav.Link>
        </Nav.Item>
        <Nav.Item>
            <Nav.Link href="/my-profile/questions" eventKey="/my-profile/questions">Questions</Nav.Link>
        </Nav.Item>
        <Nav.Item>
            <Nav.Link href="/my-profile/comments" eventKey="/my-profile/comments">Comments</Nav.Link>
        </Nav.Item>
        <Nav.Item>
            <Nav.Link href="/my-profile/followers" eventKey="/my-profile/followers">Followers</Nav.Link>
        </Nav.Item>
        <Nav.Item>
            <Nav.Link href="/my-profile/followings" eventKey="/my-profile/followings">Followings</Nav.Link>
        </Nav.Item>
        <Nav.Item>
            <Nav.Link href="/my-profile/help" eventKey="/my-profile/help">Help</Nav.Link>
        </Nav.Item>
        </Nav>
    </>
    );
}
export default UserNavigationSection;
